import { Container, Jumbotron } from 'react-bootstrap';

function Home() {
  return (
    <div className="home">
      <Jumbotron fluid className="bg-dark text-white">
        <Container>
          <h1>Welcome to Financial Diary!</h1>
          <p>Manage and track your financial assets in one place.</p>
        </Container>
      </Jumbotron>
      <Container className="welcome-statement">
        <p>Explore the latest market trends, manage your stock portfolio, and make informed investment decisions with our comprehensive financial tools.</p>
      </Container>
    </div>
  );
}
